              </div>
              <div style={{ width: "50%", flex: "1", alignItems: "center" }}>
                {/* <img src={groupProjectData.fourthPhase.image} alt="Prototype" /> */}

                <div className="flex flex-col">
                  <div style={{ flex: "1", alignItems: "center" }}>
                    <img
                      src={groupProjectData.fourthPhase.image}
                      alt="Prototype"
